import './App.css';
import Header from './Header';
import List from './List';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/tasks'>
          <div className='app' style={{ marginTop: '2rem' }}>
            <Header />
            <List />
          </div>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
